import App from "App";
import { ProtectedRoute } from "components";
import {
  Route,
  createBrowserRouter,
  createRoutesFromElements,
} from "react-router-dom";
import { axiosInstance } from "./axios_interceptor";
import PageWithLoadingPlaceholder from "components/PageWithLoadingPlaceholder";
import TestSkeletonSuspense from "example/ExampleSuspense";
import ProtectedRouteExample from "example/ProtectedRouteExample";
import NotProtectedRouteExample from "example/NotProtectedRouteExample";
import FormWithPasswordExample from "example/FormWithPasswordExample";
import RouterLoaderDataExample from "example/RouterLoaderDataExample";

const router = createBrowserRouter(
  createRoutesFromElements(
    <Route
      path="*"
      loader={({ params }) => {
        console.log("index loader log");

        return "This is the App";
      }}
      element={<App />}
    >
      <Route
        path="formWithPasswordExample"
        element={<FormWithPasswordExample />}
      />
      <Route element={<PageWithLoadingPlaceholder />}>
        <Route
          path="theming"
          element={<RouterLoaderDataExample />}
          loader={async ({ request, params }) => {
            return await axiosInstance
              .get("https://dummyjson.com/products")
              .then((response) => response.data);
          }}
          action={
            // performing this mutation when data is submitted to it
            async ({ request }) => {
              /* return updateFakeTeam(await request.formData()); */
            }
          }
        />
      </Route>
      <Route path="skeleton" element={<TestSkeletonSuspense />} />
      <Route
        path="protected-route-example"
        element={
          <ProtectedRoute logged={true}>
            <ProtectedRouteExample />
          </ProtectedRoute>
        }
      />{" "}
      <Route
        path="not-protected-route-example"
        element={
          <ProtectedRoute logged={false}>
            <NotProtectedRouteExample />
          </ProtectedRoute>
        }
      />
    </Route>
  )
);

export default router;
